@Test
  public void testCompare_UNDERSCORE_DEFAULT() {
    assertThat(TRANSLATION_COMPARATOR.compare(
      new Translation(Language.of("_"), "underscore"),
      new Translation(Language.of("<default>"), "default")
    )).isLessThan(0);

    assertThat(TRANSLATION_COMPARATOR.compare(
      new Translation(Language.of("<default>"), "default"),
      new Translation(Language.of("_"), "underscore")
    )).isGreaterThan(0);
  }

